import com.serenegiant.usb.UsbDescriptor
import org.junit.Test
import org.junit.Assert.*

class UsbDescriptorTest {

	@Test
	fun parseTest() {
		var descriptor = UsbDescriptor(RAW_DESCRIPTOR)
		do {
			assertTrue(descriptor.isValid)
			assertNotEquals(0, descriptor.length)
			assertNotEquals(0, descriptor.type)
			val shrink = descriptor.shrink()
			assertEquals(descriptor.length, shrink.length)
			assertEquals(descriptor.type, shrink.type)
			assertFalse(shrink.hasNext)
			if (descriptor.hasNext) {
				descriptor = descriptor.next()
			} else {
				break
			}
		} while (descriptor.isValid)
		assertFalse(descriptor.hasNext)
	}

